import DayNightToggle from 'react-day-and-night-toggle'

export default function Nav({swtichMode, darkMode}) {
    return (
        <>
        <nav className='py-5 mb-12 flex justify-between sticky top-0 z-50'>
            <div className='flex items-center'>
                <h1 className='text-xl font-burtons dark:text-white p-4'>Tesfatsion Shiferaw</h1>
                { !darkMode ? 
                <p className=' text-black ml-9'>Night<BsFillMoonStarsFill onClick={swtichMode} className='flex cursor-pointer text-black dark:text-gray-50'/></p>:
                <p className=' text-gray-50 ml-9'>Day<BsFillMoonStarsFill onClick={swtichMode} className='flex cursor-pointer text-black dark:text-gray-50'/></p>
                }
                <DayNightToggle
                    onChange={() => setIsDarkMode(!isDarkMode)}
                    checked={isDarkMode}
                    />
            </div>

            <ul className='flex items-center'>
              <li><a className=' bg-gradient-to-r from-cyan-500 to-teal-800 text-white px-4 py-2 rounded ml-8' href='#'>Resume</a></li>
            </ul>
        </nav>
        </>
    )
}
